x="0" aria-selected="true" aria-controls="ot-tab-desc"><h3 id="ot-pvcy-txt">Genel tanım</h3></div></li><li class="ot-cat-item ot-always-active-group ot-vs-config" role="presentation" data-optanongroupid="C0001"><div class="category-menu-switch-handler" role="tab" tabindex="-1" aria-selected="false" aria-controls="ot-desc-id-C0001"><h3 id="ot-header-id-C0001">Hizmetin Sunulması İçin Gerekli Çerezler</h3></div></li><li class="ot-cat-item ot-always-active-group ot-vs-config" role="presentation" data-optanongroupid="C0002"><div class="category-menu-switch-handler" role="tab" tabindex="-1" aria-selected="false" aria-controls="ot-desc-id-C0002"><h3 id="ot-header-id-C0002">Performans ve işlevsellik çerezleri</h3></div></li><li class="ot-cat-item ot-vs-config" role="presentation" data-optanongroupid="C0003"><div class="category-menu-switch-handler" role="tab" tabindex="-1" aria-selected="false" aria-controls="ot-desc-id-C0003"><h3 id="ot-header-id-C0003">Üçüncü taraf performans ve işlevsellik çerezleri</h3></div></li><li class="ot-cat-item ot-vs-config" role="presentation" data-optanongroupid="C0004"><div class="category-menu-switch-handler" role="tab" tabindex="-1" aria-selected="false" aria-controls="ot-desc-id-C0004"><h3 id="ot-header-id-C0004">Reklam çerezleri</h3></div></li></ul></div><div class="ot-tab-desc ot-sdk-eight ot-sdk-columns"><div class="ot-desc-cntr" id="ot-tab-desc" tabindex="0" role="tabpanel" aria-labelledby="ot-pvcy-hdr"><h4 id="ot-pvcy-hdr">Genel tanım</h4><p id="ot-pc-desc" class="ot-grp-desc"><br>Bu çerez aracı, kimlerin cihazınızdan bilgi toplamak için çerezleri kullandığını, onların bu bilgileri ne amaçla kullandıklarını ve gerekli olmayan faaliyetler için çerezlerin kullanımını nasıl kontrol edebileceğinizi anlamanıza yardımcı olacaktır.<br>
<br>
Netflix; Dijital Reklamcılık Birliği (DAA), Kanada Dijital Reklamcılık Birliği (DAAC) ve Avrupa İnteraktif Dijital Reklamcılık Birliği (EDAA) tarafından kabul edilen Çevrimiçi Davranışsal Reklamcılık İçin Öz Denetim İlkelerini destekler.<br>
<br>
Reklam çerezlerini devre dışı bırakırsanız, Netflix reklamlarını diğer sitelerde görmeye devam edebilirsiniz. Fakat bu reklamlar biz ya da hizmet sağlayıcılarımız tarafından özelleştirilen reklamlar olmayacaktır. Biz, web sitemiz üzerindeki deneyiminizi, reddetmediğiniz çerezleri kullanarak özelleştirmeye devam edeceğiz.<br>
<br>
Alternatif olarak, çoğu tarayıcıda yer alan gizlilik ayarları; tarayıcınızın yeni çerezler kabul etmesini engellemenizi, yeni bir çerez aldığınızda uyarı almanızı veya çerezleri tamamen devre dışı bırakmanızı sağlayabilir. Tarayıcınız hiçbir çerezi kabul etmeyecek şekilde ayarlanmışsa, İlgi Alanına Dayalı Reklamları almazsınız, fakat Netflix hizmetini kullanımınızda hata ve sorunlarla karşılaşabilirsiniz. Ayrıca, belli çerezleri devre dışı bırakmak için çerez aracımızı kullanmanız durumunda, cihazınıza bir çerez yerleştirilerek devre dışı bırakma tercihleriniz hatırlanır. Bu sebeple, tarayıcınızın çerezleri kabul edecek şekilde yapılandırılması tercihlerinizin kayda geçmesi için önemlidir. Çerezlerinizi siler ya da temizlerseniz ya da kullandığınız web tarayıcıyı değiştirirseniz, çerez tercihlerinizi yeniden ayarlamanız gerekir.<br>
<br>
Çerezleri kullanımımıza ilişkin daha fazla bilgi edinmek için <a href="https://help.netflix.com/legal/privacy">Gizlilik Bildirimi</a> sözleşmemizin <a href="https://help.netflix.com/legal/privacy#cookies">Çerezler ve İnternet Reklamcılığı</a> bölümüne başvurun.<br>

<br></p></div><div class="ot-desc-cntr ot-hide ot-always-active-group" role="tabpanel" tabindex="0" id="ot-desc-id-C0001"><div class="ot-grp-hdr1"><h4 class="ot-cat-header">Hizmetin Sunulması İçin Gerekli Çerezler</h4><div class="ot-tgl-cntr"><div class="ot-always-active">Her Zaman Etkin</div></div></div><p class="ot-grp-desc ot-category-desc">Bu çerezler, web sitemizi veya çevrimiçi hizmetimizi sunmak için kesinlikle gereklidir. Örneğin, biz ve Hizmet Sağlayıcılarımız, bu çerezleri ziyaretçilerimiz web sitelerimizi ve uygulamalarımızı kullandığında kendilerine hizmetlerimizi sunabilmek amacıyla, üyelerimizin kimliğini doğrulamak ve tanımlamak için kullanabiliriz. Ayrıca Kullanım Koşullarımızı uygulamamıza, dolandırıcılığı önlememize ve hizmetlerimizin güvenliğini sağlamamıza yardımcı olurlar.<br>
<br>
Kullanım süresi: Çerezlerin çoğu oturum çerezleridir (diğer bir deyişle bu çerezler siz tarayıcınızı kapatana kadar etkindir) veya sadece bir günlüğüne etkindir. Bazı çerezler daha uzun bir süre etkin kalır. Bu süre, 3 ila 12 ay arasında değişebilir. Dolandırıcılığı önlemek ve hizmetlerimizin güvenliğini korumak için kullanılan çerezler en fazla 24 aylık bir süre boyunca etkindir.</p><div class="ot-hlst-cntr"><button class="ot-link-btn category-host-list-handler" aria-label="düğmesi Tanımlama Bilgileri Penceresini açar" data-parent-id="C0001">Genel tanım&lrm;</button></div></div><div class="ot-desc-cntr ot-hide ot-always-active-group" role="tabpanel" tabindex="0" id="ot-desc-id-C0002"><div class="ot-grp-hdr1"><h4 class="ot-cat-header">Performans ve işlevsellik çerezleri</h4><div class="ot-tgl-cntr"><div class="ot-always-active">Her Zaman Etkin</div></div></div><p class="ot-grp-desc ot-category-desc">Bu çerezler Netflix'teki çevrimiçi deneyiminizi özelleştirmemize ve pekiştirmemize yardımcı olur. Örneğin, tercihlerinizi hatırlamamıza yardımcı olur ve daha önce girdiğiniz bilgileri (örneğin üye kaydı sırasında) yeniden girmenizin gerekmesini önlerler. Bu çerezleri ayrıca ziyaretçilerimizin Netflix hizmeti kullanımları hakkında bilgi toplamak (popüler sayfalar, geri dönüş oranları, izleme modelleri, tıklanan bağlantılar ve diğer bilgiler gibi) ve böylece web sitemiz ve hizmetimizi geliştirip özelleştirebilmek ve pazar araştırması yapabilmek için kullanırız. Bu tür çerezlerin silinmesi, hizmetimizin sınırlı işlevsellikle kullanılmasına neden olabilir.<br>
<br>
Kulanım süresi: Çerezlerin çoğu sadece bir günlüğüne etkindir. Bazı çerezler daha uzun bir süre etkin kalır. Bu süre, 3 ila 12 ay arasında değişebilir.</p><div class="ot-hlst-cntr"><button class="ot-link-btn category-host-list-handler" aria-label="düğmesi Tanımlama Bilgileri Penceresini açar" data-parent-id="C0002">Genel tanım&lrm;</button></div></div><div class="ot-desc-cntr ot-hide" role="tabpanel" tabindex="0" id="ot-desc-id-C0003"><div class="ot-grp-hdr1"><h4 class="ot-cat-header">Üçüncü taraf performans ve işlevsellik çerezleri</h4><div class="ot-tgl"><input type="checkbox" name="ot-group-id-C0003" id="ot-group-id-C0003" aria-checked="true" role="switch" class="category-switch-handler" data-optanongroupid="C0003" checked="" aria-labelledby="ot-header-id-C0003"> <label class="ot-switch" for="ot-group-id-C0003"><span class="ot-switch-nob" aria-checked="false" role="switch"></span> <span class="ot-label-txt">Üçüncü taraf performans ve işlevsellik çerezleri</span></label> </div><div class="ot-tgl-cntr"></div></div><p class="ot-grp-desc ot-category-desc">Üçüncü taraflarca yerleştirilen bu çerezler, Netflix'te yaşadığınız çevrimiçi deneyimi özelleştirmemize ve iyileştirmemize yardımcı olurlar. Örneğin Tudum'da, sosyal medya içeriğini göstermek gibi üçüncü şahıslar tarafından sunulan deneyimleri sağlamamıza yardımcı olurlar. Bu üçüncü tarafların bu tür çerezleri nasıl kullandığı hakkında daha fazla bilgi için lütfen üçüncü tarafın web sitesinde sağlanan gizlilik bilgilerine bakın. Bu tür çerezlerin silinmesi, hizmetimizin sınırlı işlevsellikle kullanılmasına neden olabilir.</p><div class="ot-hlst-cntr"><button class="ot-link-btn category-host-list-handler" aria-label="düğmesi Tanımlama Bilgileri Penceresini açar" data-parent-id="C0003">Genel tanım&lrm;</button></div></div><div class="ot-desc-cntr ot-hide" role="tabpanel" tabindex="0" id="ot-desc-id-C0004"><div class="ot-grp-hdr1"><h4 class="ot-cat-header">Reklam çerezleri</h4><div class="ot-tgl"><input type="checkbox" name="ot-group-id-C0004" id="ot-group-id-C0004" aria-checked="false" role="switch" class="category-switch-handler" data-optanongroupid="C0004" aria-labelledby="ot-header-id-C0004"> <label class="ot-switch" for="ot-group-id-C0004"><span class="ot-switch-nob" aria-checked="false" role="switch"></span> <span class="ot-label-txt">Reklam çerezleri</span></label> </div><div class="ot-tgl-cntr"></div></div><p class="ot-grp-desc ot-category-desc">Bu çerezler, bu ve diğer web sitelerini ve uygulamaları kullanımınız, reklamlar ve e-postalara yanıtlarınız gibi bilgileri, size daha fazla hitap eden reklamları sunmak için ve analiz ve optimizasyon amaçlarıyla kullanır. Bu türdeki reklamlara "ilgi alanına dayalı reklamcılık" denir ve bu reklamlar Netflix etki alanı dışında gösterilir. Netflix, reklam iş ortaklarının yaptığınız belirli içerik seçimlerine, açtığınız URL'lere ve hizmetimizde izlediğiniz programlara dair bilgilere ulaşmasını engellemek için tasarlanmış olan akdi ve teknik önlemler alır. İçerik seçimlerine ve hizmetimizde izlediğiniz programlara dair bilgi paylaşmayız. Hizmetimizle ilişkili reklam çerezleri, çerez ayrıntıları kısmında listelendiği şekilde reklam iş ortaklarımıza aittir. Lütfen reklam çerezleri ayarlarınızı aşağıdan seçin. Tüm web sitelerindeki reklam çerezlerini devre dışı bırakmak için <a href="https://optout.aboutads.info/" rel="nofollow">buraya</a> gidin.<br>
<br></p><div class="ot-hlst-cntr"><button class="ot-link-btn category-host-list-handler" aria-label="düğmesi Tanımlama Bilgileri Penceresini açar" data-parent-id="C0004">Genel tanım&lrm;</button></div></div></div></div></div><!-- Vendors / Hosts --><section id="ot-pc-lst" class="ot-hide ot-enbl-chr"><div class="ot-lst-cntr ot-pc-scrollbar"><div id="ot-pc-hdr"><div id="ot-lst-title"><button class="ot-link-btn back-btn-handler" aria-label="Back"><svg id="ot-back-arw" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" viewBox="0 0 444.531 444.531" xml:space="preserve"><title>Back Button</title><g><path fill="#656565" d="M213.13,222.409L351.88,83.653c7.05-7.043,10.567-15.657,10.567-25.841c0-10.183-3.518-18.793-10.567-25.835
